Owner_Email_Coverage_2.query:
q = load "${App.Datasets.UX_Sample_Data_21_tp.FullyQualifiedName}";
result = group q by ('Account_Owner', 'Email_Coverage');
result = foreach result generate q.'Account_Owner' as 'Account_Owner', q.'Email_Coverage' as 'Email_Coverage', first(Account_Owner_Image) as 'Account_Owner_Image', count(q) as 'A';
result = group result by ('Account_Owner', 'Email_Coverage');
result = foreach result generate 'Account_Owner', 'Email_Coverage', first(A) as 'A', sum(A)/sum(sum(A)) over ([..] partition by 'Account_Owner') as 'B',first(Account_Owner_Image) as 'Account_Owner_Image';
result = order result by ('A' desc);
result = limit result 2000;

